import React, { useState, useMemo } from 'react';
import { Calendar, BarChart3, Clock, Users, TrendingUp, Filter, Download } from 'lucide-react';

const HourlyFreeOnboardReport = () => {
  const [selectedView, setSelectedView] = useState('table');
  const [highlightPeaks, setHighlightPeaks] = useState(true);

  // Sample data structure based on your API response
  const apiData = {
    "status_code": 200,
    "message": "Hourly report generated successfully",
    "data": [
      {
        "date": "2025-05-26",
        "hours": {
          "0-1": 0, "1-2": 0, "2-3": 0, "3-4": 0, "4-5": 0, "5-6": 0,
          "6-7": 0, "7-8": 0, "8-9": 0, "9-10": 0, "10-11": 4, "11-12": 0,
          "12-13": 0, "13-14": 0, "14-15": 0, "15-16": 0, "16-17": 0, "17-18": 0,
          "18-19": 0, "19-20": 0, "20-21": 0, "21-22": 0, "22-23": 0, "23-24": 0
        }
      },
      {
        "date": "2025-05-24",
        "hours": {
          "0-1": 0, "1-2": 0, "2-3": 0, "3-4": 0, "4-5": 0, "5-6": 0,
          "6-7": 0, "7-8": 0, "8-9": 0, "9-10": 0, "10-11": 3, "11-12": 0,
          "12-13": 0, "13-14": 0, "14-15": 0, "15-16": 0, "16-17": 0, "17-18": 0,
          "18-19": 0, "19-20": 0, "20-21": 0, "21-22": 0, "22-23": 0, "23-24": 0
        }
      },
      {
        "date": "2025-05-23",
        "hours": {
          "0-1": 0, "1-2": 0, "2-3": 0, "3-4": 0, "4-5": 0, "5-6": 0,
          "6-7": 0, "7-8": 0, "8-9": 0, "9-10": 0, "10-11": 3, "11-12": 8,
          "12-13": 0, "13-14": 2, "14-15": 6, "15-16": 0, "16-17": 0, "17-18": 6,
          "18-19": 0, "19-20": 0, "20-21": 0, "21-22": 0, "22-23": 0, "23-24": 0
        }
      },
      {
        "date": "2025-05-22",
        "hours": {
          "0-1": 0, "1-2": 0, "2-3": 0, "3-4": 0, "4-5": 0, "5-6": 0,
          "6-7": 0, "7-8": 0, "8-9": 0, "9-10": 0, "10-11": 0, "11-12": 0,
          "12-13": 0, "13-14": 0, "14-15": 5, "15-16": 6, "16-17": 3, "17-18": 4,
          "18-19": 1, "19-20": 0, "20-21": 0, "21-22": 0, "22-23": 0, "23-24": 0
        }
      },
      {
        "date": "2025-05-21",
        "hours": {
          "0-1": 0, "1-2": 0, "2-3": 0, "3-4": 0, "4-5": 0, "5-6": 0,
          "6-7": 0, "7-8": 0, "8-9": 0, "9-10": 0, "10-11": 5, "11-12": 6,
          "12-13": 3, "13-14": 1, "14-15": 5, "15-16": 4, "16-17": 2, "17-18": 0,
          "18-19": 0, "19-20": 0, "20-21": 0, "21-22": 0, "22-23": 0, "23-24": 0
        }
      }
    ]
  };

  // Generate hour headers (24 hours)
  const hourHeaders = useMemo(() => {
    const headers = [];
    for (let i = 0; i < 24; i++) {
      headers.push(`${i}-${i + 1}`);
    }
    return headers;
  }, []);

  // Calculate totals and statistics
  const statistics = useMemo(() => {
    const dayTotals = apiData.data.map(day => ({
      date: day.date,
      total: Object.values(day.hours).reduce((sum, value) => sum + value, 0)
    }));

    const hourTotals = {};
    hourHeaders.forEach(hour => {
      hourTotals[hour] = apiData.data.reduce((sum, dayData) => sum + (dayData.hours[hour] || 0), 0);
    });

    const grandTotal = Object.values(hourTotals).reduce((sum, value) => sum + value, 0);
    const avgPerDay = grandTotal / apiData.data.length;
    const peakHour = Object.keys(hourTotals).reduce((a, b) => hourTotals[a] > hourTotals[b] ? a : b);
    const peakValue = hourTotals[peakHour];

    return { dayTotals, hourTotals, grandTotal, avgPerDay, peakHour, peakValue };
  }, [apiData, hourHeaders]);

  const formatTime = (hourRange) => {
    const [start] = hourRange.split('-');
    const hour = parseInt(start);
    const period = hour >= 12 ? 'PM' : 'AM';
    const displayHour = hour === 0 ? 12 : hour > 12 ? hour - 12 : hour;
    return `${displayHour}${period}`;
  };

  const getIntensityColor = (value, max) => {
    if (value === 0) return 'bg-gray-50';
    const intensity = value / max;
    if (intensity >= 0.8) return 'bg-red-500 text-white';
    if (intensity >= 0.6) return 'bg-orange-400 text-white';
    if (intensity >= 0.4) return 'bg-yellow-400 text-black';
    if (intensity >= 0.2) return 'bg-green-300 text-black';
    return 'bg-green-100 text-black';
  };

  const maxValue = Math.max(...Object.values(statistics.hourTotals));

  return (
    <div className="min-h-screen bg-gray-50 p-4">
      <div className="max-w-7xl mx-auto">
        {/* Header Section */}
        <div className="bg-white rounded-xl shadow-sm border border-gray-200 mb-6">
          <div className="p-6">
            <div className="flex items-center justify-between mb-4">
              <div className="flex items-center space-x-3">
                <div className="p-2 bg-blue-100 rounded-lg">
                  <BarChart3 className="w-6 h-6 text-blue-600" />
                </div>
                <div>
                  <h1 className="text-2xl font-bold text-gray-900">Hourly Free Onboard Report</h1>
                  <p className="text-sm text-gray-600">{apiData.message}</p>
                </div>
              </div>
              <div className="flex items-center space-x-3">
                <button className="flex items-center space-x-2 px-4 py-2 bg-blue-600 text-white rounded-lg hover:bg-blue-700 transition-colors">
                  <Download className="w-4 h-4" />
                  <span>Export</span>
                </button>
              </div>
            </div>

            {/* Statistics Cards */}
            <div className="grid grid-cols-1 md:grid-cols-4 gap-4">
              <div className="bg-gradient-to-r from-blue-500 to-blue-600 text-white p-4 rounded-lg">
                <div className="flex items-center justify-between">
                  <div>
                    <p className="text-blue-100 text-sm">Total Onboards</p>
                    <p className="text-2xl font-bold">{statistics.grandTotal}</p>
                  </div>
                  <Users className="w-8 h-8 text-blue-200" />
                </div>
              </div>

              <div className="bg-gradient-to-r from-green-500 to-green-600 text-white p-4 rounded-lg">
                <div className="flex items-center justify-between">
                  <div>
                    <p className="text-green-100 text-sm">Daily Average</p>
                    <p className="text-2xl font-bold">{statistics.avgPerDay.toFixed(1)}</p>
                  </div>
                  <TrendingUp className="w-8 h-8 text-green-200" />
                </div>
              </div>

              <div className="bg-gradient-to-r from-purple-500 to-purple-600 text-white p-4 rounded-lg">
                <div className="flex items-center justify-between">
                  <div>
                    <p className="text-purple-100 text-sm">Peak Hour</p>
                    <p className="text-2xl font-bold">{formatTime(statistics.peakHour)}</p>
                  </div>
                  <Clock className="w-8 h-8 text-purple-200" />
                </div>
              </div>

              <div className="bg-gradient-to-r from-orange-500 to-orange-600 text-white p-4 rounded-lg">
                <div className="flex items-center justify-between">
                  <div>
                    <p className="text-orange-100 text-sm">Peak Value</p>
                    <p className="text-2xl font-bold">{statistics.peakValue}</p>
                  </div>
                  <Calendar className="w-8 h-8 text-orange-200" />
                </div>
              </div>
            </div>
          </div>
        </div>

        {/* Controls */}
        <div className="bg-white rounded-xl shadow-sm border border-gray-200 mb-6 p-4">
          <div className="flex items-center justify-between">
            <div className="flex items-center space-x-4">
              <div className="flex items-center space-x-2">
                <Filter className="w-4 h-4 text-gray-500" />
                <span className="text-sm font-medium text-gray-700">View:</span>
                <select 
                  value={selectedView} 
                  onChange={(e) => setSelectedView(e.target.value)}
                  className="border border-gray-300 rounded-md px-3 py-1 text-sm focus:outline-none focus:ring-2 focus:ring-blue-500"
                >
                  <option value="table">Table View</option>
                  <option value="heatmap">Heatmap View</option>
                </select>
              </div>

              <label className="flex items-center space-x-2">
                <input 
                  type="checkbox" 
                  checked={highlightPeaks} 
                  onChange={(e) => setHighlightPeaks(e.target.checked)}
                  className="rounded border-gray-300 text-blue-600 focus:ring-blue-500"
                />
                <span className="text-sm text-gray-700">Highlight Peaks</span>
              </label>
            </div>
          </div>
        </div>

        {/* Main Content */}
        <div className="bg-white rounded-xl shadow-sm border border-gray-200">
          <div className="p-6">
            {selectedView === 'table' ? (
              <div className="overflow-x-auto">
                <table className="w-full">
                  <thead>
                    <tr className="border-b-2 border-gray-200">
                      <th className="text-left py-3 px-4 font-semibold text-gray-700">Date</th>
                      {hourHeaders.map(hour => (
                        <th key={hour} className="text-center py-3 px-2 font-semibold text-gray-700 text-xs">
                          <div>{hour.split('-')[0]}</div>
                          <div className="text-xs text-gray-500">{formatTime(hour)}</div>
                        </th>
                      ))}
                      <th className="text-center py-3 px-4 font-semibold text-gray-700 bg-blue-50">Total</th>
                    </tr>
                  </thead>
                  <tbody>
                    {apiData.data.map((dayData, index) => (
                      <tr key={dayData.date} className={`border-b border-gray-100 hover:bg-gray-50 transition-colors ${index % 2 === 0 ? 'bg-white' : 'bg-gray-25'}`}>
                        <td className="py-4 px-4 font-medium text-gray-900">
                          <div className="flex items-center space-x-2">
                            <Calendar className="w-4 h-4 text-gray-400" />
                            <div>
                              <div className="font-semibold">
                                {new Date(dayData.date).toLocaleDateString('en-US', {
                                  weekday: 'short',
                                  month: 'short',
                                  day: 'numeric'
                                })}
                              </div>
                              <div className="text-xs text-gray-500">
                                {new Date(dayData.date).getFullYear()}
                              </div>
                            </div>
                          </div>
                        </td>
                        {hourHeaders.map(hour => {
                          const value = dayData.hours[hour] || 0;
                          const isPeak = highlightPeaks && value > 0 && hour === statistics.peakHour;
                          return (
                            <td key={hour} className={`text-center py-4 px-2 text-sm ${
                              value > 0 
                                ? isPeak 
                                  ? 'bg-red-100 text-red-800 font-bold border border-red-200' 
                                  : 'bg-blue-50 text-blue-800 font-semibold'
                                : 'text-gray-400'
                            } transition-all hover:scale-110`}>
                              {value > 0 ? value : '·'}
                            </td>
                          );
                        })}
                        <td className="text-center py-4 px-4 font-bold text-blue-700 bg-blue-50">
                          {statistics.dayTotals.find(d => d.date === dayData.date)?.total || 0}
                        </td>
                      </tr>
                    ))}
                  </tbody>
                  <tfoot>
                    <tr className="bg-gray-100 font-semibold">
                      <td className="py-4 px-4 text-gray-700">Totals</td>
                      {hourHeaders.map(hour => (
                        <td key={hour} className={`text-center py-4 px-2 text-sm ${
                          statistics.hourTotals[hour] > 0 
                            ? hour === statistics.peakHour && highlightPeaks
                              ? 'bg-red-200 text-red-800 font-bold'
                              : 'text-gray-800'
                            : 'text-gray-400'
                        }`}>
                          {statistics.hourTotals[hour] > 0 ? statistics.hourTotals[hour] : '·'}
                        </td>
                      ))}
                      <td className="text-center py-4 px-4 font-bold text-white bg-blue-600">
                        {statistics.grandTotal}
                      </td>
                    </tr>
                  </tfoot>
                </table>
              </div>
            ) : (
              /* Heatmap View */
              <div className="space-y-6">
                <div className="flex items-center justify-between">
                  <h3 className="text-lg font-semibold text-gray-900">Activity Heatmap</h3>
                  <div className="flex items-center space-x-2 text-sm text-gray-600">
                    <span>Low</span>
                    <div className="flex space-x-1">
                      <div className="w-3 h-3 bg-gray-100 rounded"></div>
                      <div className="w-3 h-3 bg-green-200 rounded"></div>
                      <div className="w-3 h-3 bg-yellow-300 rounded"></div>
                      <div className="w-3 h-3 bg-orange-400 rounded"></div>
                      <div className="w-3 h-3 bg-red-500 rounded"></div>
                    </div>
                    <span>High</span>
                  </div>
                </div>

                <div className="grid gap-4">
                  {apiData.data.map(dayData => (
                    <div key={dayData.date} className="flex items-center space-x-4">
                      <div className="w-24 text-sm font-medium text-gray-700">
                        {new Date(dayData.date).toLocaleDateString('en-US', {
                          month: 'short',
                          day: 'numeric'
                        })}
                      </div>
                      <div className="flex space-x-1 flex-1">
                        {hourHeaders.map(hour => {
                          const value = dayData.hours[hour] || 0;
                          return (
                            <div
                              key={hour}
                              className={`w-6 h-6 rounded ${getIntensityColor(value, maxValue)} flex items-center justify-center text-xs font-medium transition-all hover:scale-125 cursor-pointer`}
                              title={`${formatTime(hour)}: ${value} onboards`}
                            >
                              {value > 0 ? value : ''}
                            </div>
                          );
                        })}
                      </div>
                      <div className="w-12 text-sm font-bold text-blue-700 text-right">
                        {statistics.dayTotals.find(d => d.date === dayData.date)?.total || 0}
                      </div>
                    </div>
